                            $TaskName = $matches[1]
                        }

                        $TaskInfo = [PSCustomObject]@{
                            Directory = $Dir.Name
                            FullPath = $Dir.FullName
                            TaskName = $TaskName
                            CreationTime = $Dir.CreationTime
                            LastWriteTime = $Dir.LastWriteTime
                            JsonFile = $JsonFile.Name
                            ContentPreview = $Content.Substring(0, [Math]::Min(200, $Content.Length)).Replace("`n", " ").Replace("`r", "")
                        }

                        $FoundTasks += $TaskInfo
                        Write-Host "TROUVE: $TaskName dans $($Dir.Name)" -ForegroundColor Green
                        break  # Sortir de la boucle des fichiers JSON pour ce repertoire
                    }
                }
