{"tool":"newFileCreated","path":"mcp-debugging/copy_test_hierarchy.ps1","content":"# Script pour copier les repertoires de la hierarchie TEST vers le repertoire de destination
$SourcePath = "C:\Users\jsboi\AppData\Roaming\Code\User\globalStorage\rooveterinaryinc.roo-cline\tasks"
$DestPath = "mcp-debugging\test-hierarchy-data"

# Liste des UUIDs des taches TEST trouvees
$TestTaskUUIDs = @(
    "e73ea764-4971-4adb-9197-52c2f8ede8ef",
    "d6a6a99a-b7fd-41fc-86ce-2f17c9520437", 
    "8c06d62c-1ee2-4c3a-991e-c9483e90c8aa",
    "38948ef0-4a8b-40a2-ae29-b38d2aa9d5a7",
    "03deadab-a06d-4b29-976d-3cc142add1d9",
    "b423bff7-6fec-40fe-a00e-bb2a0ebb52f4",
    "305b3f90-e0e1-4870-8cf4-4fd33a08cfa4",
    "91e837de-a4b2-4c18-ab9b-6fcd36596e38"
)

Write-Host "=== COPIE DE LA HIERARCHIE TEST VERS LE REPERTOIRE DE DESTINATION ===" -ForegroundColor Green
Write-Host "Source: $SourcePath" -ForegroundColor Yellow
Write-Host "Destination: $DestPath" -ForegroundColor Yellow
Write-Host "Taches a copier: $($TestTaskUUIDs.Count)" -ForegroundColor Cyan
Write-Host ""

# Creer le repertoire de destination s'il n'existe pas
if (-not (Test-Path $DestPath)) {
    Write-Host "Creation du repertoire de destination..." -ForegroundColor Yellow
    New-Item -Path $DestPath -ItemType Directory -Force | Out-Null
}

$SuccessfulCopies = @()
$FailedCopies = @()
$TotalSize = 0

foreach ($UUID in $TestTaskUUIDs) {
    $SourceDir = Join-Path $SourcePath $UUID
    $DestDir = Join-Path $DestPath $UUID

    Write-Host "Copie de: $UUID" -ForegroundColor White

    if (Test-Path $SourceDir) {
        try {
            # Copier tout le repertoire avec son contenu
            Copy-Item -Path $SourceDir -Destination $DestDir -Recurse -Force

            # Calculer la taille copiee
            $Size = (Get-ChildItem -Path $DestDir -Recurse -File | Measure-Object -Property Length -Sum).Sum
            $TotalSize += $Size
            $SizeKB = [math]::Round($Size / 1024, 2)

            Write-Host "  >>> COPIE REUSSIE ($SizeKB KB)" -ForegroundColor Green

            # Lister les fichiers copies
            $Files = Get-ChildItem -Path $DestDir -File
            Write-Host "  Fichiers copies:" -ForegroundColor Gray
            foreach ($File in $Files) {
                Write-Host "    - $($File.Name) ($([math]::Round($File.Length/1024, 2)) KB)" -ForegroundColor Gray
            }

            $SuccessfulCopies += $UUID
        }
        catch {
            Write-Host "  >>> ERREUR DE COPIE: $($_.Exception.Message)" -ForegroundColor Red
            $FailedCopies += $UUID
        }
    }
    else {
        Write-Host "  >>> REPERTOIRE SOURCE INTROUVABLE" -ForegroundColor Red
        $FailedCopies += $UUID
    }

    Write-Host ""
}

Write-Host "=== RAPPORT DE COPIE ===" -ForegroundColor Green
Write-Host "Copies reussies: $($SuccessfulCopies.Count)" -ForegroundColor Green
Write-Host "Copies echouees: $($FailedCopies.Count)" -ForegroundColor Red
Write-Host "Taille totale copiee: $([math]::Round($TotalSize / 1024, 2)) KB" -ForegroundColor Cyan

if ($SuccessfulCopies.Count -gt 0) {
    Write-Host "`nRepertoires copies avec succes:" -ForegroundColor Green
    foreach ($UUID in $SuccessfulCopies) {
        Write-Host "  ‚úÖ $UUID" -ForegroundColor White
    }
}

if ($FailedCopies.Count -gt 0) {
    Write-Host "`nRepertoires non copies:" -ForegroundColor Red
    foreach ($UUID in $FailedCopies) {
        Write-Host "  ‚ùå $UUID" -ForegroundColor White
    }
}

# Creer un fichier de resultats
$ResultsFile = Join-Path $DestPath "COPY_RESULTS.txt"
$Results = @()
$Results += "=== RAPPORT DE COPIE HIERARCHIE TEST ==="
$Results += "Date: $(Get-Date)"
$Results += "Copies reussies: $($SuccessfulCopies.Count)"
$Results += "Copies echouees: $($FailedCopies.Count)"
$Results += "Taille totale: $([math]::Round($TotalSize / 1024, 2)) KB"
$Results += ""
$Results += "REPERTOIRES COPIES AVEC SUCCES:"
foreach ($UUID in $SuccessfulCopies) {
    $Results += "  ‚úÖ $UUID"
}
if ($FailedCopies.Count -gt 0) {
    $Results += ""
    $Results += "REPERTOIRES NON COPIES:"
    foreach ($UUID in $FailedCopies) {
        $Results += "  ‚ùå $UUID"
    }
}

$Results | Out-File -FilePath $ResultsFile -Encoding UTF8
Write-Host "`nResultats sauvegardes dans: $ResultsFile" -ForegroundColor Green

Write-Host "`nCopie terminee." -ForegroundColor Green","isOutsideWorkspace":false,"isProtected":false}
